import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "./DogRunPage.css";
import DogrunImage from "../assets/images/Dogrun/dogrun.png";
import ImageSlider from "../../ImageSlider";
import Header from "../Header";
import Footer from "../Footer";

interface Store {
  id: number;
  store_name: string;
  description: string;
  store_img: string[];
  address: string;
  phone_number: string;
  opening_hours: string;
  store_url: string;
}

const DogRunPage: React.FC = () => {
  const navigate = useNavigate();
  const [stores, setStores] = useState<Store[]>([]);
  const [storeData, setStoreData] = useState<Store[] | null>(null);

  const handleClick = () => {
    navigate('/DogrunRegionsList');
  };

  useEffect(() => {
    // 全店舗データを取得
    const fetchStores = async () => {
      try {
        const response = await fetch("http://localhost:5003/stores");
        const data: Store[] = await response.json();
        setStores(data);
      } catch (error) {
        console.error("店舗データの取得に失敗しました:", error);
      }
    };

    fetchStores();
  }, []);

  useEffect(() => {
    // store_type=1 の店舗データを取得
    const fetchStoreData = async () => {
      try {
        const response = await fetch("http://localhost:5003/stores/type/1"); // store_type=1
        const data: Store[] = await response.json();
        setStoreData(data);
      } catch (error) {
        console.error("データ取得エラー:", error);
      }
    };

    fetchStoreData();
  }, []);

  return (
    <>
      <Header />
      <div className="dogrun-page-container">
        <p onClick={handleClick} className="search-dogrun">
          全国のドッグランを探す
        </p>
        <div>
          <img src={DogrunImage} alt="DogrunImage" className="dogrun-image" />
        </div>
        <div className="store-list">
          {stores.map((store) => (
            <div key={store.id} className="store-card">
              <img src={store.store_img[0]} alt={store.store_name} className="store-image" />
              <h3>{store.store_name}</h3>
            </div>
          ))}
        </div>
        {storeData && (
          <div>
            {storeData.map((store, index) => (
              <div key={index}>
                <ImageSlider images={store.store_img} />
                <h1>{store.store_name}</h1>
              </div>
            ))}
          </div>
        )}
      </div>
      <Footer />
    </>
  );
};

export default DogRunPage;
